import React from "react";
import { Link } from '../../routes';


import {
    Card,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Dropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    InputGroup,
    InputGroupAddon,
    InputGroupText,
    FormInput,
    Button,
    Collapse
  } from "shards-react";

  export default class NavBar extends React.Component {
    constructor(props) {
      super(props);
  
      this.toggleDropdown = this.toggleDropdown.bind(this);
      this.toggleNavbar = this.toggleNavbar.bind(this);
  
      this.state = {
        dropdownOpen: false,
        collapseOpen: false
      };
    }
  
    toggleDropdown() {
      this.setState({
        ...this.state,
        ...{
          dropdownOpen: !this.state.dropdownOpen
        }
      });
    }
  
    toggleNavbar() {
      this.setState({
        ...this.state,
        ...{
          collapseOpen: !this.state.collapseOpen
        }
      });
    }
  
    render() {
      return (   <div>
        <Navbar type="dark" theme="primary" expand="md">
          <NavbarBrand href="/">Crypto Asset Consortium</NavbarBrand>
          <NavbarToggler onClick={this.toggleNavbar} />
  
          <Collapse open={this.state.collapseOpen} navbar>
            <Nav type="light" navbar>
              <NavItem>
                <NavLink active href="/assetpool">
                  Interest Asset Pool
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink active href="#">
                  Interest Loan Protocol
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink active href="#">
                  Loan Funding Protocol
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink active href="#">
                  Compound Interest Protocol
                </NavLink>
              </NavItem>
            </Nav>
            <Nav className="ml-auto">
              <NavItem>
                <NavLink active href="#">
                  <Button outline theme="success" size="md" className="mb-2 mr-1">
                  APP
                  </Button>
                </NavLink>
              </NavItem>
            </Nav>
            <Nav navbar className="ml-auto">
            <Dropdown
                open={this.state.dropdownOpen}
                toggle={this.toggleDropdown}
              >
                <DropdownToggle nav caret>
                  
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>FAQ</DropdownItem>
                  <DropdownItem>Contact</DropdownItem>
                  <DropdownItem>Something else here</DropdownItem>
                </DropdownMenu>
              </Dropdown>
            </Nav>
          </Collapse>
        </Navbar>
     
          <style jsx>{` .nav-item {color:yellow;}
           `}  </style>
        </div>
      );
    }
  }
